import 'data.dart';

class AdhanModel {
  int? code;
  String? status;
  Data? data;

  AdhanModel({this.code, this.status, this.data});

  factory AdhanModel.(
    Map<String, dynamic> json,
  ) {
    return AdhanModel(
      code: json['code'] as int?,
      status: json['status'] as String?,
      data: json['data'] == null
          ? null
          : Data.(
              json['data'] as Map<String, dynamic>,
            ),
    );
  }

  Map<String, dynamic>
  () {
    return {
      'code': code,
      'status': status,
      'data': data
          ?.(),
    };
  }
}
